window.bookSummaryJSON = "<p><b>A Two-Book Military Sci-Fi Collection</b></p> <p>In war, mistakes kill.</p> <p>Earth's fleet has just made the biggest one ever.</p> <p>The alien race's sacred relic, destroyed by a misfire.&nbsp;</p> <p>First contact devolves into war.</p> <p>Anderson Cross, his XO Kate Flynn, and the crew of the Washington have never faced such a challenge.</p> <p>Can they adapt quickly enough to survive the vanguard of the alien invasion?</p> <p>Can the fleet turn the enemy back?</p> <p>Or have Earth's children reached the end of the line?</p> <p>You'll love this rocket-paced action adventure because of its strong characters and the life-or-death stakes that push them to their limits - and beyond.&nbsp;</p> <p>Will humanity fall?&nbsp;</p> <p><b>Get it now.</b></p>"; 
